    value: 'Federal Election Commission  Washington D.C.  Att: Ms. Nicole Della Rocco    Dear
      Ms. Rocco:    We are in receipt of your letter dated April 22, 2009 regarding
      our amended 30 Day Post General Report (10/16/08-11/24/08) in which you questioned
      the following:    1.  Our amended report discloses additional receipts and disbursements
      that were not in our original filing.  During the reporting period the Wyoming
      Republican Party switched software providers for thier campaign finance compliance
      needs.  The necessary data to make a complete and accurate filing had not been
      converted to the new software by the date the filing was due.  It was determined
      that a report should be filed with an amendment to follow rather than miss the
      report filing deadline.    2.  Line 12 of our report discloses transfers from
      Senators Enzi and Barasso to the wyoming Republican Party.  The report has been
      amended to include the word Transfer in the description of this activity.    3.  Schedule
      B supporting line 30(b) discloses payments for FEA activity in which the communcations
      paid for clearly support, attack or oppose a specific candidate.  Our report
      has been amended to identify the specific candidate and the office for which
      he sought.  All other FEA expenditures not specifically addressed did NOT support,
      attack or oppose a specific candidate.    4.  Schedule B supporting line 21(b)
      disclosed a payment for an FEA Mailer that should have been reported on line
      30(b).  The report has been amended to correct the error.    Sincerely,    Donna
      Robitaille, Treasurer  Wyoming Republican Party'
